import React from 'react';
import Image from './Image';

class Pokemon extends React.Component {
  render() {
    const { name, type } = this.props.pokemon;
    return (
      <p>Nome: {name},
        <br />Tipo: {type}</p>
    );
  }
}

export default Pokemon;
